import { ContextMenu } from "./ContextMenu"
import { save } from "./save"

export const UI = () => {
  const inputStyle = {
    display: "absolute",
    border: 0,
    margin: "8px 16px"
  }

  return <div
    style={{
      position: "absolute",
      display: "flex",
      flexDirection: "row",
      zIndex: 1,
      right: 0,
      width: "100vw",
      height: "100vh"
    }}
  >
    <input
      type="button"
      value="Save"
      style={inputStyle}
      onClick={save}
    />
    <ContextMenu
      first={true}
    />
  </div>
}
